import React from "react";
import UseAnimations from 'react-useanimations';

const SocialMedia = () => {

    return (
        <div className="social-network">
            <UseAnimations className="social-media-item" animationKey="github" autoplay={true} style={{width:"34px"}} />    
            <UseAnimations className="social-media-item" animationKey="linkedin" style={{width:"34px"}} />    
            <UseAnimations className="social-media-item" animationKey="facebook" style={{width:"34px"}} />    
            <UseAnimations className="social-media-item" animationKey="download" style={{width:"34px"}} />    

        </div>
    );
} 

export default SocialMedia;
